def createStateGroup(stateGroupName):
    return  {
        "parent": "\\States\\Default Work Unit",
        "type": "StateGroup",
        "name": stateGroupName
    }    

def createState(parent, stateName):
    return  {
        "parent": parent,
        "type": "State",
        "name": stateName
    }   

try:
    # Connecting to Waapi using default URL
    with WaapiClient() as client:

        for key, value in states.items():
            stateGroupName = key

            # Create the State Group
            client.call("ak.wwise.core.object.create", createStateGroup(stateGroupName))
        
            # Get info about created State Group
            stateGroupArgs = {
                "from": {
                    "path": ["\\States\\Default Work Unit\\" + stateGroupName]
                },
                "options": {
                    "return": ["id", "name"]
                }
            }
            createdStateGroup = client.call("ak.wwise.core.object.get", stateGroupArgs)
            print("Created State Group: " + createdStateGroup['return'][0]['name'])
    
            for i in states[key]:
                stateName = i
                ## Create the State
                if stateName != "None":
                    client.call("ak.wwise.core.object.create", createState(createdStateGroup['return'][0]['id'], stateName))

                    # Get info about created State
                    stateArgs = {
                        "from": {
                            "path": ["\\States\\Default Work Unit\\" + createdStateGroup['return'][0]['name'] + "\\" + stateName]
                        },
                        "options": {
                            "return": ["id", "name"]
                        }
                    }
                    createdState = client.call("ak.wwise.core.object.get", stateArgs)
                    print("Created State: " + createdState['return'][0]['name'])

except CannotConnectToWaapiException:
    print("Could not connect to Waapi: Is Wwise running and Wwise Authoring API enabled?")

except Exception as e:
    print(str(e))